import React, { Fragment, useState, useEffect, useContext } from "react";
import FadeIn from "react-fade-in";
import LoadingScreen from "./LoadingScreen";
import DoughnutChart from "../components/Chart/DoughnutChart";
import { PresenceContext } from "../providers/PresenceContext";

const PresenceLive = () => {
  const [title, setTitle] = useState("Kordon - Gedebage");
  const [presence, setPresence] = useState("");
  const [leave, setLeave] = useState("");
  const [absence, setAbsence] = useState("");
  const [late, setLate] = useState("");
  const [percentage, setPercentage] = useState(0);
  const [zone, setZone] = useState([]);
  const red = "#D9534F";
  const yellow = "#FFCC2F";
  const green = "#5CB85C";

  // * context
  const { liveZone, loading } = useContext(PresenceContext);

  useEffect(() => {
    // eslint-disable-next-line
    const result = liveZone.filter((value) => {
      if (value.regionName.toLowerCase().includes(title.toLowerCase())) {
        return value;
      }
    });

    setZone(result);
    setPercentage(
      result.map((value) => (value.value == null ? 0 : value.value.percentage))
    );
    setPresence(
      result.map((value) => (value.value == null ? 0 : value.value.presence))
    );
    setLeave(
      result.map((value) => (value.value == null ? 0 : value.value.leave))
    );
    setAbsence(
      result.map((value) => (value.value == null ? 0 : value.value.absence))
    );
    setLate(
      result.map((value) => (value.value == null ? 0 : value.value.late))
    );
  }, [liveZone, title]);

  const status = (p) => {
    let result = "";

    if (p <= 33 && p >= 0) {
      result = red;
    } else if (p <= 66 && p >= 34) {
      result = yellow;
    } else if (p <= 100 && p >= 67) {
      result = green;
    }

    return result;
  };

  return loading ? (
    <LoadingScreen />
  ) : (
    <FadeIn>
      <div className="container-fluid mt-4">
        <div className="card shadow mb-4">
          <div className="card-header py-3 d-flex flex-row align-items-center justify-content-between">
            <h6 className="m-0 font-weight-bold text-primary">
              Peta Sebaran Absensi
            </h6>
          </div>

          <div className="card-body">
            <Map set={setTitle} status={status} percentage={percentage} />
          </div>
        </div>

        <div className="card shadow mb-4">
          <div className="card-header py-3 d-flex flex-row align-items-center">
            <h6 className="m-0 font-weight-bold text-primary">
              Chart Absensi {title}
            </h6>
          </div>

          <div className="card-body">
            <div className="row">
              {zone.map((value, index) => {
                return (
                  <div className="col-md-3" key={index}>
                    <div style={{ width: 200, height: 200, marginBottom: 50 }}>
                      {percentage[index] === 0 ? (
                        <center>
                          <p>Belum Ada Data</p>
                        </center>
                      ) : (
                        <DoughnutChart
                          key={index}
                          position={value.codeZone}
                          presence={presence[index]}
                          leave={leave[index]}
                          absence={absence[index]}
                          late={late[index]}
                        />
                      )}

                      <center>
                        <p style={{ marginBottom: 20 }}>{value.codeZone}</p>
                      </center>
                    </div>
                  </div>
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </FadeIn>
  );
};

const Map = ({ set, status, percentage }) => {
  return (
    <div className="blocks" id="map_frontpage">
      <div className="jvectormap-container">
        <svg width="985" height="450">
          <defs></defs>
          <g transform="scale(0.7227561323904272) translate(231.4193307099542, 0)">
            <Bojonagara set={set} color={status(percentage)} />
            <Tegalega set={set} color={status(percentage)} />
            <Karees set={set} color={status(percentage)} />
            <Cibeunying set={set} color={status(percentage)} />
            <Kordon set={set} color={status(percentage)} />
            <Ujungberung set={set} color={status(percentage)} />
          </g>
        </svg>
      </div>
    </div>
  );
};

